  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144342 includes discrete
  sample and profile data collected from unknown platforms in the North Atlantic Ocean,
  North Sea and Norwegian Sea from 1874-01-01 to 2005-12-31. These data include DELTA
  CARBON-13, DELTA CARBON-14 and Percent modern carbon (PMC). The instruments used
  to collect these data include CTD and bottle.nnThese data were collected by Jan
  Heinemeier of Aarhus University; Department of Physics and Astronomy; AMS 14C Dating
  Centre, James D. Scourse of Bangor University; School of Ocean Sciences, Alan D.
  Wanamaker Jr. of Iowa State University; Department of Geological and Atmospheric
  Sciences, Paula J. Reimer of Queen's University Belfast; 14CHRONO Centre and Chris
  Weidman of Waquoit Bay National Estuarine Research Reserve as part of the Delta
  14C Time Histories from Arctica Islandica Growth Increments data set. CDIAC associated
  the following cruise ID(s) with this data set: Marine Radiocarbon Bomb Pulse Across
